selector_to_html = {"a[href=\"#miller-brain-observatory-compute-ecosystem\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Miller Brain Observatory: Compute Ecosystem<a class=\"headerlink\" href=\"#miller-brain-observatory-compute-ecosystem\" title=\"Permalink to this heading\">#</a></h1><p>A hub for tutorials, guides and resources for computational image processing.</p>", "a[href=\"#software\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"#blogs-and-posts\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">Blogs and Posts<a class=\"headerlink\" href=\"#blogs-and-posts\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"dev/doc/workflow_docs.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Github Workflow<a class=\"headerlink\" href=\"#github-workflow\" title=\"Permalink to this heading\">#</a></h1><p>Documentaion deployment is handled primarily through a github action workflow. By deployment,\nwe really mean the instructions that send our <cite>html</cite> to a public server that can be linked to and\naccessed from any browser.</p><p>The workflow that manages where our <cite>html</cite> files go is <a class=\"reference external\" href=\"https://github.com/peaceiris/actions-gh-pages\">peaceitis\u2019 github action workflow</a></p>", "a[href=\"guides/index.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">User Guides<a class=\"headerlink\" href=\"#user-guides\" title=\"Permalink to this heading\">#</a></h1><p>Guides for users analyzing microscopy data.</p>", "a[href=\"#pipelines\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pipelines<a class=\"headerlink\" href=\"#pipelines\" title=\"Permalink to this heading\">#</a></h2><h3>LBM-CaImAn-MATLAB<a class=\"headerlink\" href=\"#lbm-caiman-matlab\" title=\"Permalink to this heading\">#</a></h3><p><a class=\"reference external\" href=\"https://github.com/MillerBrainObservatory/LBM-CaImAn-MATLAB\"><img alt=\"Lbm-CaImAn-MATLAB Repository\" src=\"https://img.shields.io/badge/Repository-black?style=flat&amp;logo=github&amp;logoColor=white&amp;logoSize=auto\"/></a> | <a class=\"reference external\" href=\"https://millerbrainobservatory.github.io/LBM-CaImAn-MATLAB/index.html\">LBM-Matlab Docs</a></p>", "a[href=\"dev/index.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Developer Guide<a class=\"headerlink\" href=\"#developer-guide\" title=\"Permalink to this heading\">#</a></h1><p>Documentation for this compute hub and the various pipelines are build using the following tools:</p>", "a[href=\"dev/doc/adding_docs.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Adding Docs<a class=\"headerlink\" href=\"#adding-docs\" title=\"Permalink to this heading\">#</a></h1><p>TODO: A quick document to reference for somebody wanting to add a quick document\npage to this repository.</p><p>This is the convention used for Python docs:</p>", "a[href=\"dev/ver/gh_branch_workflow.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Dev Branches: What, Why, and When?<a class=\"headerlink\" href=\"#dev-branches-what-why-and-when\" title=\"Permalink to this heading\">#</a></h1><p><em>adapted from firefox open source contribution guide</em></p><p><code class=\"docutils literal notranslate\"><span class=\"pre\">development</span></code> branches (idiomatically abbreviated <code class=\"docutils literal notranslate\"><span class=\"pre\">dev</span></code>) are simply a branch for working on batches of code being actively worked-on but not yet merged into the code that the general user will be using and that people see when they open the repository on github: <code class=\"docutils literal notranslate\"><span class=\"pre\">master</span></code>.\nThe reason for dev branches is mainly to <strong>avoid large pull-requests (PR)</strong>. Its very important for reviewers to understand and trust every change to the codebase, which small PR\u2019s greatly facilitate.</p>", "a[href=\"#lbm-caiman-python\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">LBM-CaImAn-Python<a class=\"headerlink\" href=\"#lbm-caiman-python\" title=\"Permalink to this heading\">#</a></h3><p><a class=\"reference external\" href=\"https://github.com/MillerBrainObservatory/LBM-CaImAn-Python\"><img alt=\"Lbm-CaImAn-Python Repository\" src=\"https://img.shields.io/badge/Repository-black?style=flat&amp;logo=github&amp;logoColor=white&amp;logoSize=auto\"/></a> | <a class=\"reference external\" href=\"https://millerbrainobservatory.github.io/LBM-CaImAn-Python/\">LBM-Python Docs</a></p>", "a[href=\"guides/imagej.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">ImageJ / FIJI<a class=\"headerlink\" href=\"#imagej-fiji\" title=\"Permalink to this heading\">#</a></h1><p>Fiji is a version of ImageJ with \u201cbatteries included\u201d. To us, this includes several HDF5/Bioformat libraries that will help load our <cite>.tiff</cite> files.</p><p>Download Fiji for your platform <a class=\"reference external\" href=\"https://imagej.net/software/fiji/downloads\">here</a>.</p>", "a[href=\"dev/doc/building_docs.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Building MBO Documentation<a class=\"headerlink\" href=\"#building-mbo-documentation\" title=\"Permalink to this heading\">#</a></h1><h2>Development environments<a class=\"headerlink\" href=\"#development-environments\" title=\"Permalink to this heading\">#</a></h2><h3>Update Docs<a class=\"headerlink\" href=\"#update-docs\" title=\"Permalink to this heading\">#</a></h3><p>The workflow to update documentation is pretty simple.</p>", "a[href=\"#external-resources\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">External Resources<a class=\"headerlink\" href=\"#external-resources\" title=\"Permalink to this heading\">#</a></h2><h3>Software<a class=\"headerlink\" href=\"#software\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"#mbo-technology-stack\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">MBO Technology Stack<a class=\"headerlink\" href=\"#mbo-technology-stack\" title=\"Permalink to this heading\">#</a></h2><p>Choosing a technology stack for a project is subjective and dynamic. The technology that works now\nmay not work as more pipelines are built and included in the documentation. Maintainability is also a concern; your\nrepository is only as maintainable as the team you have to maintain it.</p><p>For these reasons, the list of tools used in the MBO is kept as simple as possible while maintaining effective\ndocumentation and resources. Let <cite>git</cite> handle all tasks and workflows that may have more \u201cmature\u201d alternatives i.e. travisCI, circleCI.\nThis is the motivation against using <a class=\"reference external\" href=\"https://www.ReadTheDocs.org\">ReadTheDocs</a> as <a class=\"reference external\" href=\"https://pages.github.com/\">github-pages</a> has the same\nfunctionality, albeit with a few more lines of code and technical expertise required in handling the <cite>github-workflows</cite>.</p>", "a[href=\"#indices-and-tables\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Indices and tables<a class=\"headerlink\" href=\"#indices-and-tables\" title=\"Permalink to this heading\">#</a></h2>", "a[href=\"#scanreader\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">scanreader<a class=\"headerlink\" href=\"#scanreader\" title=\"Permalink to this heading\">#</a></h3>", "a[href=\"dev/ver/gh_pr_naming.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Naming the PR<a class=\"headerlink\" href=\"#naming-the-pr\" title=\"Permalink to this heading\">#</a></h1><p>The name of a PR is important, because it will eventually become the commit that shows up in <code class=\"docutils literal notranslate\"><span class=\"pre\">main</span></code>. Here are the guidelines for how to name a PR.</p><p>PR name:</p>", "a[href=\"#lbm-caiman-matlab\"]": "<h3 class=\"tippy-header\" style=\"margin-top: 0;\">LBM-CaImAn-MATLAB<a class=\"headerlink\" href=\"#lbm-caiman-matlab\" title=\"Permalink to this heading\">#</a></h3><p><a class=\"reference external\" href=\"https://github.com/MillerBrainObservatory/LBM-CaImAn-MATLAB\"><img alt=\"Lbm-CaImAn-MATLAB Repository\" src=\"https://img.shields.io/badge/Repository-black?style=flat&amp;logo=github&amp;logoColor=white&amp;logoSize=auto\"/></a> | <a class=\"reference external\" href=\"https://millerbrainobservatory.github.io/LBM-CaImAn-MATLAB/index.html\">LBM-Matlab Docs</a></p>", "a[href=\"guides/scanimage.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Exploring LBM Datasets<a class=\"headerlink\" href=\"#exploring-lbm-datasets\" title=\"Permalink to this heading\">#</a></h1><p>ScanImage <a class=\"reference external\" href=\"https://docs.scanimage.org/Premium+Features/Multiple+Region+of+Interest+(MROI).html\">mROI (Multi Region Of Interest)</a> outputs raw <code class=\"docutils literal notranslate\"><span class=\"pre\">.tiff</span></code> files made up of individual <code class=\"docutils literal notranslate\"><span class=\"pre\">Regions</span> <span class=\"pre\">of</span> <span class=\"pre\">Interest</span> <span class=\"pre\">(ROI's)</span></code>.\nIn the raw output, these <code class=\"docutils literal notranslate\"><span class=\"pre\">ROIs</span></code> are vertically concatenated independent of their actual scan locations.\nThe location of each ROI is stored as a pixel coordinate used internally by the respective pipeline to orient each strip.</p>"}
skip_classes = ["headerlink", "sd-stretched-link"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(` ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
